import React from "react";
import ReactDOM from "react-dom";
import index from "./index.css";


const im2 = "https://assets.stickpng.com/images/59060d740cbeef0acff9a660.png"
const lmaz="https://www.youtube.com/channel/UCsDgfBQJ6xGLe-N75UZl41w"


ReactDOM.render(
<>
<h1 calss="heading"> Muhammad Zaeem </h1>
<p>Here is My youtube Channel</p>
<a href={lmaz} target="_blank">
<img src={im2} />
</a>
</>,
document.getElementById("root")
);
